import { Link } from "react-router-dom";
import Home from "../Home";

function Nav(){
    return(
        <div className="header">
          
          <Link to="/">Home</Link>
          {!!localStorage.getItem('token')&&
            <Link to="/Login">Login</Link>}
         
        </div>
    );
}
export default Nav;
